    true,nt"url": null,nt"notes": "The 1990 Census Block Statistics portion
    of the Archive of Census Related Products (ACRP) contains population and housing
    data from the U.S. Census Bureau's 1990 Summary Tape File (STF1B). The population
    data includes total population, age, race, and hispanic origin, while the housing
    data comprises number of housing units, tenure, room density, mean contract rent,
    mean value, and mean number of rooms. Additional data includes land area, water
    area, centroids, Metropolitan Statistical Area (MSA) codes, place codes, and special
    area codes. This portion of the ACRP is produced by the Columbia University Center
    for International Earth Science Information Network (CIESIN).",nt"license_title":
